#define EN 26



typedef struct worddictionary {
    struct worddictionary* trie_node[26];
    bool leaf_node;

} WordDictionary;


WordDictionary* wordDictionaryCreate()
{
   WordDictionary* node = (WordDictionary*)malloc(sizeof(WordDictionary));
   node->leaf_node = false;
   for(int i = 0; i < 26; i++)
       node->trie_node[i] = NULL;

   return node;
}

void wordDictionaryAddWord(WordDictionary* obj, char * word)
{
    int i, len, idx;

    len = strlen(word);
    for(i = 0; i < len; i++)
    {
        idx = word[i] - 'a';
        if(obj->trie_node[idx])
            obj = obj->trie_node[idx];
        else
        {
            obj = obj->trie_node[idx] = wordDictionaryCreate();
        }
    }
    obj->leaf_node = true;
}


bool wordDictionarySearch(WordDictionary* obj, char * word)
{
    printf("search word is %s in %#x\n", word, obj);
    int i, j, len, idx;
    char* temp = NULL;
    bool ret = false;

    len = strlen(word);
    temp = (char*)calloc(len + 1, sizeof(char));
    for(i = 0; i < len; i++)
    {
        if(word[i] == '.' && i < len - 1)
        {
            for(j = 0; j < 26; j++)
            {
                if(obj->trie_node[j])
                {
                    strncpy(temp, &word[i+1], len - i);
                    if(wordDictionarySearch(obj->trie_node[j], temp))
                    {
                        free(temp);
                        return true;
                    }
                }

            }
            free(temp);
            return false;
        }
        else if(word[i] == '.' && i == len - 1)
        {
            for(j = 0; j < 26; j++)
            {
                if(obj->trie_node[j] && obj->trie_node[j]->leaf_node)
                {
                    free(temp);
                    return true;
                }
            }
            free(temp);
            return false;
        }
        else
        {
            idx = word[i] - 'a';
            if(obj->trie_node[idx])
            {
                obj = obj->trie_node[idx];
            }
            else
            {
                free(temp);
                return false;
            }
        }
    }

    free(temp);
    if(obj->leaf_node)
        return true;
    else
        return false;
}

void wordDictionaryFree(WordDictionary* obj)
{
    for(int i = 0; i < 26; i++)
        if(obj->trie_node[i])
            wordDictionaryFree(obj->trie_node[i]);
    free(obj);
}
